import{r as a,o as r,c as t,a as e,b as n,F as o,d as c,e as s}from"./app.9aaa2256.js";import{_}from"./plugin-vue_export-helper.21dcd24c.js";const d={},i=c('<h3 id="\u5730\u94C1\u54FA\u4E73\u8BE5\u4E0D\u8BE5" tabindex="-1"><a class="header-anchor" href="#\u5730\u94C1\u54FA\u4E73\u8BE5\u4E0D\u8BE5" aria-hidden="true">#</a> \u5730\u94C1\u54FA\u4E73\u8BE5\u4E0D\u8BE5\uFF1F</h3><p>\u5FAE\u535A\u4E0A@\u5317\u4EAC\u5F80\u4E8B\u7F51\u7AD9 \u53D1\u4E86\u4E00\u6761\u5FAE\u535A\uFF0C\u6307\u8D23\u4E00\u4E2A\u5728\u5730\u94C1\u4E0A\u54FA\u4E73\u7684\u5988\u5988\uFF0C\u8BF4\u4E0D\u8981\u88F8\u9732\u6027\u5668\u5B98\uFF0C\u5E76\u8BF4\u8FD9\u91CC\u662F\u5317\u4EAC\u7684\u5730\u94C1\u4E4B\u4E0A\uFF0C\u4E0D\u662F\u4F60\u4EEC\u6751\u7684\u516C\u4EA4\u8F66\uFF0C\u540C\u65F6\u628A\u8FD9\u4F4D\u5988\u5988\u54FA\u4E73\u7684\u7167\u7247\u8D34\u4E0A\u6765\u4E86\uFF0C\u5F15\u53D1\u5F88\u591A\u6279\u8BC4\u548C\u8BAE\u8BBA\u3002</p><p>\u62CD\u522B\u4EBA\u54FA\u4E73\u7167\u5E76\u4F20\u5230\u7F51\u4E0A\u7684\u884C\u4E3A\u663E\u7136\u662F\u5F88\u6076\u52A3\u7684\uFF0C\u6307\u8D23\u54FA\u4E73\u4E3A\u88F8\u9732\u6027\u5668\u5B98\u4E5F\u662F\u5F88\u8FC7\u5206\u7684\uFF0C\u8BC4\u8BBA\u6709\u7684\u4EBA\u4E5F\u8BF4\u5F97\u7279\u522B\u597D\uFF0C\u6BD4\u5982\u7F51\u53CB@\u79D1\u5B66\u5BB6\u79CD\u592A\u9633 \u7684\u610F\u89C1\u3002\u522B\u7684\u6211\u5C31\u4E0D\u591A\u8BF4\u4E86\uFF0C\u6211\u5C31\u8BF4\u8BF4\u6211\u5BF9\u516C\u5171\u573A\u6240\u54FA\u4E73\u7684\u770B\u6CD5\u5427\u3002</p><p>\u4E0D\u540C\u7684\u65F6\u4EE3\uFF0C\u4E0D\u540C\u7684\u793E\u4F1A\uFF0C\u516C\u5E8F\u826F\u4FD7\u786E\u5B9E\u6709\u4E0D\u540C\u7684\u6807\u51C6\uFF0C\u800C\u4E14\u8FD9\u4E2A\u6807\u51C6\u4E5F\u5728\u968F\u7740\u793E\u4F1A\u7684\u53D1\u5C55\u4E0D\u505C\u7684\u53D8\u8FC1\u3002\u752830\u5E74\u524D\u4EBA\u4EEC\u7684\u773C\u5149\u6765\u770B\uFF0C\u73B0\u5728\u8857\u5934\u7A7F\u8D85\u77ED\u88D9\u7684\u4F30\u8BA1\u90FD\u7B97\u4F24\u98CE\u8D25\u4FD7\uFF0C\u5728\u81EA\u5BB6\u9633\u53F0\u4E0A\u6652\u8863\u88E4\u5E8A\u5355\u4EC0\u4E48\u7684\u6211\u4EEC\u89C9\u5F97\u4E60\u4EE5\u4E3A\u5E38\uFF0C\u5728\u4E00\u4E9B\u56FD\u5BB6\u5374\u88AB\u8BA4\u4E3A\u6709\u788D\u89C2\u77BB\u4E0D\u88AB\u63A5\u53D7\u3002</p><p>\u5728\u6211\u4EEC\u5F53\u524D\u7684\u516C\u5E8F\u826F\u4FD7\u6807\u51C6\u4E4B\u4E0B\uFF0C\u5728\u516C\u5171\u573A\u6240\u65E0\u7F18\u7531\u7684\u8892\u9732\u4E73\u623F\u662F\u666E\u904D\u4E0D\u88AB\u63A5\u53D7\u7684\uFF0C\u8FD9\u5E94\u8BE5\u6CA1\u6709\u4EC0\u4E48\u5F02\u8BAE\uFF0C\u4F46\u5BF9\u4E8E\u54FA\u4E73\u9700\u8981\u7684\u5766\u9732\uFF0C\u63A5\u53D7\u5EA6\u5B58\u5728\u5206\u6B67\uFF0C\u4E3B\u8981\u662F\u56E0\u4E3A\u54FA\u4E73\u5988\u5988\u8892\u9732\u4E73\u623F\u7ED9\u4E00\u4E9B\u4EBA\u5E26\u6765\u5FC3\u7406\u4E0A\u7684\u4E0D\u9002\u3002</p><p>\u8FD9\u79CD\u5C34\u5C2C\u611F\u6211\u662F\u53EF\u4EE5\u7406\u89E3\u7684\uFF0C\u8BB0\u5F97\u5F53\u5E74\u8BFB\u4E66\u5728\u533B\u9662\u5B9E\u4E60\u65F6\uFF0C\u81EA\u5DF1\u8FD8\u662F\u4E2A\u6BDB\u5934\u5C0F\u5B50\uFF0C\u867D\u7136\u77E5\u9053\u6BCD\u4E73\u5582\u517B\u7684\u597D\u5904\uFF0C\u4F46\u5230\u4E86\u75C5\u623F\u770B\u5230\u8FD9\u4E9B\u5988\u5988\u4F17\u76EE\u777D\u777D\u4E4B\u4E0B\u54FA\u4E73\uFF0C\u5FC3\u7406\u4E0A\u4E5F\u662F\u633A\u5C34\u5C2C\u7684\uFF0C\u4F46\u540E\u6765\u89C1\u591A\u4E86\u4E5F\u5C31\u4E60\u60EF\u4E86\uFF0C\u7B49\u81EA\u5DF1\u7ED3\u5A5A\u751F\u5B50\u4E4B\u540E\uFF0C\u5BF9\u8FD9\u79CD\u884C\u4E3A\u4E5F\u5C31\u66F4\u80FD\u7406\u89E3\u4E86\u3002\u5F88\u591A\u5988\u5988\u4ECE\u672A\u5A5A\u5C11\u5973\u8F6C\u53D8\u5230\u4E86\u4E00\u4E2A\u54FA\u4E73\u5988\u5988\uFF0C\u5BF9\u8FD9\u79CD\u54FA\u4E73\u65B9\u5F0F\u53EF\u80FD\u4E5F\u6709\u7C7B\u4F3C\u5FC3\u7406\u8F6C\u53D8\u8FC7\u7A0B\u3002</p><p>\u4F46\u6211\u4E0D\u4F1A\u56E0\u4E3A\u81EA\u5DF1\u63A5\u53D7\u4E86\uFF0C\u5C31\u5F3A\u5236\u522B\u4EBA\u4E5F\u4E00\u5B9A\u8981\u63A5\u53D7\u3002\u4F60\u89C9\u5F97\u54FA\u4E73\u662F\u5F88\u81EA\u7136\uFF0C\u5F88\u4F1F\u5927\u7684\u4E8B\u60C5\uFF0C\u4F46\u6BCF\u4E2A\u4EBA\u7684\u4EF7\u503C\u89C2\u5BA1\u7F8E\u89C2\u4E0D\u540C\uFF0C\u4E0D\u80FD\u5F3A\u6C42\u522B\u4EBA\u4E5F\u8FD9\u6837\u8BA4\u4E3A\u3002\u4F60\u53EF\u80FD\u4F1A\u8BF4\u4E0D\u63A5\u53D7\u4E0D\u770B\u5C31\u597D\u4E86\uFF0C\u4F46\u5728\u516C\u5171\u573A\u6240\u8C01\u4E5F\u80FD\u4FDD\u8BC1\u81EA\u5DF1\u4F1A\u4E0D\u5C0F\u5FC3\u770B\u5230\u4E00\u773C\uFF0C\u5982\u679C\u81EA\u5DF1\u5750\u5730\u94C1\u770B\u5230\u6709\u4E2A\u7537\u4EBA\u5149\u7740\u4E0A\u8EAB\u4E0A\u6765\u53EF\u80FD\u4E5F\u4F1A\u4E0D\u723D\u5427\u3002</p><p>\u4E5F\u53EF\u80FD\u6709\u4EBA\u8BF4\uFF0CT\u53F0\u4E0A\u9732\u6210\u90A3\u6837\u600E\u4E48\u90FD\u6CA1\u4EBA\u8BF4\uFF0C\u600E\u4E48\u5582\u4E2A\u5976\u5C31\u8FD9\u6837\u3002\u821E\u53F0\u8FD9\u79CD\u7279\u6B8A\u7684\u73AF\u5883\u548C\u751F\u6D3B\u73AF\u5883\u5F53\u7136\u4E5F\u662F\u6709\u533A\u522B\u7684\uFF0C\u8C01\u8981\u662F\u5728\u65E5\u5E38\u751F\u6D3B\u4E2D\u7A7F\u592A\u5938\u5F20\u7684\u620F\u670D\u4F30\u8BA1\u540C\u6837\u4F1A\u6709\u4EBA\u8BF4\u3002</p><p>\u4E5F\u6709\u4EBA\u8BF4\uFF0C\u65C1\u89C2\u8005\u6700\u591A\u4E00\u70B9\u70B9\u5C0F\u5BB3\uFF0C\u5BF9\u4E8E\u5988\u5988\u5374\u662F\u5927\u5229\uFF0C\u4F55\u4E50\u800C\u4E0D\u4E3A\uFF1F\u8FD9\u8BA9\u6211\u60F3\u8D77\u524D\u4E0D\u4E45\u5728\u533B\u9662\u7535\u68AF\u91CC\u7684\u4E00\u6B21\u7ECF\u5386\uFF0C\u7535\u68AF\u91CC\u6EE1\u6EE1\u7684\u4EBA\uFF0C\u4E00\u5927\u5988\u4E00\u8FB9\u5F80\u91CC\u6324\u4E00\u8FB9\u558A\uFF1A\u91CC\u9762\u7684\u4EBA\u5F80\u91CC\u8D70\u8D70\u554A\uFF0C\u91CC\u9762\u7684\u4EBA\u8BF4\uFF1A\u90FD\u5DF2\u7ECF\u8D34\u7740\u73BB\u7483\u4E86\u3002\u5927\u5988\u8BF4\uFF1A\u6211\u8FD9\u62B1\u7740\u5C0F\u5B69\u5462\uFF0C\u91CC\u9762\u90A3\u4E2A\u4EBA\u6162\u6162\u8F6C\u8FC7\u8EAB\uFF0C\u5927\u5988\u4E00\u770B\u90A3\u4EBA\u6000\u91CC\u4E5F\u9732\u51FA\u4E2A\u5C0F\u5B69\uFF0C\u8BF4\uFF1A\u4F60\u90A3\u5B69\u5B50\u5C0F\uFF0C\u597D\u62B1\u3002</p><p>\u5728\u5FAE\u535A\u4E0A\u5E38\u5E38\u4E5F\u6709\u56E0\u4E3A\u54A8\u8BE2\u5B69\u5B50\u75C5\u60C5\u6CA1\u56DE\u590D\u5C31\u7834\u53E3\u5927\u9A82\u6CA1\u533B\u5FB7\u7684\uFF0C\u505A\u4ED8\u8D39\u9605\u8BFB\u65F6\u4E5F\u6709\u4EBA\u8BF4\uFF0C\u4E3A\u4E86\u5B69\u5B50\u6765\u5B66\u70B9\u77E5\u8BC6\uFF0C\u4F60\u5C45\u7136\u8981\u94B1\u662F\u4E0D\u662F\u60F3\u94B1\u60F3\u75AF\u4E86\uFF1F\u56E0\u4E3A\u81EA\u5DF1\u5B69\u5B50\u6709\u9700\u6C42\uFF0C\u5C31\u8981\u6C42\u5168\u4E16\u754C\u90FD\u8BA9\u7740\u5979\uFF0C\u5426\u5219\u5C31\u7834\u53E3\u5927\u9A82\u7684\u4EBA\u5927\u6709\u4EBA\u5728\u3002</p><p>\u5168\u793E\u4F1A\u90FD\u5E94\u8BE5\u5173\u7231\u513F\u7AE5\u662F\u6CA1\u9519\uFF0C\u4F46\u513F\u7AE5\u6743\u76CA\u7684\u4FDD\u62A4\u80AF\u5B9A\u8FD8\u662F\u4E0D\u80FD\u8D85\u8131\u6CD5\u5F8B\u6CD5\u89C4\u548C\u793E\u4F1A\u516C\u5E8F\u7684\u6807\u51C6\uFF0C\u4E5F\u4E0D\u53EF\u80FD\u5728\u5F53\u524D\u7684\u793E\u4F1A\u7ECF\u6D4E\u53D1\u5C55\u6C34\u5E73\u4E4B\u4E0B\u5B8C\u5168\u5957\u7528\u56FD\u5916\u7684\u6807\u51C6\uFF0C\u800C\u4E14\u6743\u5229\u548C\u4E49\u52A1\u662F\u5BF9\u7B49\u7684\uFF0C\u771F\u8981\u6309\u56FD\u5916\u7684\u6807\u51C6\u6765\uFF0C\u56FD\u5185\u5F88\u591A\u7236\u6BCD\u65E9\u5C31\u8BE5\u88AB\u5265\u593A\u76D1\u62A4\u4EBA\u8D44\u683C\u4E86\u3002</p><p>\u90A3\u516C\u5171\u573A\u6240\u54FA\u4E73\u5582\u517B\u4ECE\u9053\u7406\u4E0A\u5E94\u4E0D\u5E94\u8BE5\u652F\u6301\u5462\uFF1F\u6211\u4E2A\u4EBA\u8BA4\u4E3A\u5E94\u8BE5\u652F\u6301\u3002</p><p>\u54FA\u4E73\u7684\u8892\u9732\u548C\u65E0\u7F18\u7531\u7684\u8892\u9732\u80AF\u5B9A\u662F\u5E94\u8BE5\u533A\u522B\u5BF9\u5F85\uFF0C\u5982\u679C\u4E0D\u662F\u4E3A\u4E86\u5B69\u5B50\uFF0C\u6CA1\u6709\u54EA\u4E2A\u6B63\u5E38\u5973\u6027\u613F\u610F\u5728\u516C\u5171\u573A\u5408\u8892\u9732\u81EA\u5DF1\u7684\u4E73\u623F\uFF0C\u884C\u4F7F\u54FA\u4E73\u529F\u80FD\u7684\u4E73\u623F\u4E5F\u5E94\u8BE5\u548C\u6027\u5524\u9192\u529F\u80FD\u7684\u4E73\u623F\u533A\u522B\u5BF9\u5F85\uFF0C\u5C24\u5176\u5728\u56FD\u5185\u6BCD\u5A74\u8BBE\u65BD\u914D\u5907\u4E0D\u5B8C\u5584\u7684\u524D\u63D0\u4E0B\u3002</p><p>\u5728\u673A\u573A\u3001\u8D2D\u7269\u4E2D\u5FC3\u8FD9\u6837\u7684\u914D\u6709\u6BCD\u5A74\u5BA4\u7684\u73AF\u5883\u4E0B\u8FD8\u597D\u4E00\u70B9\uFF0C\u5982\u679C\u662F\u5E26\u5B69\u5B50\u53BB\u533B\u9662\u770B\u75C5\uFF0C\u4E00\u7B49\u7B49\u5927\u534A\u5929\uFF0C\u800C\u8FD9\u5BB6\u533B\u9662\u5374\u8FD8\u53EF\u80FD\u6CA1\u6709\u6BCD\u5A74\u5BA4\uFF0C\u5982\u679C\u4E0D\u5728\u516C\u5171\u573A\u6240\u54FA\u4E73\u90A3\u5C31\u53EA\u6709\u8EB2\u5230\u5395\u6240\u91CC\u533A\u54FA\u4E73\u4E86\uFF0C\u6211\u6240\u77E5\u9053\u7684\u5C31\u662F\u6DF1\u5733\u8FD9\u6837\u7684\u57CE\u5E02\uFF0C\u5F88\u591A\u5E02\u7EA7\u533B\u9662\u90FD\u6CA1\u6709\u6BCD\u5A74\u5BA4\u3002\u5728\u56FD\u5185\u7684\u57CE\u5E02\u5E26\u5B69\u5B50\u5916\u51FA\u4E00\u4E24\u4E2A\u5C0F\u65F6\u5185\u627E\u4E0D\u5230\u6BCD\u5A74\u5BA4\u4E5F\u4E0D\u662F\u5F88\u7A00\u5947\u7684\u4E8B\u3002</p><p>\u5B69\u5B50\u548C\u5927\u4EBA\u4E0D\u4E00\u6837\uFF0C\u5927\u4EBA\u591A\u997F\u51E0\u4E2A\u5C0F\u65F6\u633A\u4E00\u633A\u4E5F\u5C31\u8FC7\u53BB\u4E86\uFF0C\u4F46\u5B69\u5B50\u591A\u997F\u8FD9\u4E48\u4E45\u5C31\u53EF\u80FD\u5BFC\u81F4\u8131\u6C34\uFF0C\u4E5F\u5982@\u533B\u751F\u5988\u5988\u6B27\u831C \u6240\u8BF4\uFF0C\u5A74\u513F\u5582\u517B\u7684\u539F\u5219\u662F\u6309\u9700\u5582\u517B\u3002\u5403\u6BCD\u4E73\u7684\u5B69\u5B50\u7A81\u7136\u6539\u7528\u5976\u74F6\u5582\u914D\u65B9\u5976\u786E\u5B9E\u6709\u7684\u5B69\u5B50\u4E0D\u63A5\u53D7\uFF0C\u63A5\u53D7\u7684\u5B69\u5B50\u6709\u7684\u53EF\u80FD\u9020\u6210\u540E\u671F\u7684\u54FA\u4E73\u5582\u517B\u56F0\u96BE\uFF0C\u6216\u8005\u51FA\u73B0\u4E00\u4E9B\u8FC7\u654F\u7B49\u76F8\u5173\u95EE\u9898\u3002</p><p>\u4E60\u60EF\u4E86\u4EB2\u5582\u7684\u5B69\u5B50\uFF0C\u6539\u7528\u5976\u74F6\u5582\u9884\u5148\u5438\u597D\u7684\u5976\uFF0C\u4E5F\u786E\u5B9E\u6709\u5B69\u5B50\u4E0D\u63A5\u53D7\u8FD9\u79CD\u6539\u53D8\u3002\u81F3\u4E8E\u54FA\u4E73\u5185\u8863\uFF0C\u54FA\u4E73\u5DFE\u4E4B\u7C7B\uFF0C\u6709\u800C\u4E14\u5B69\u5B50\u80FD\u63A5\u53D7\u5F53\u7136\u66F4\u597D\uFF0C\u4F46\u6211\u4EEC\u7684\u56FD\u60C5\u4E4B\u4E0B\u4E0D\u4E86\u89E3\u8FD9\u4E9B\u4E1C\u897F\u7684\u6BCD\u4EB2\u5927\u6709\u4EBA\u5728\uFF0C\u5728\u906E\u76D6\u7684\u73AF\u5883\u4E0B\u5B69\u5B50\u4E0D\u613F\u8FDB\u98DF\u6216\u8005\u54ED\u95F9\u7684\u60C5\u51B5\u4E5F\u786E\u5B9E\u6709\u3002\u5982\u679C\u5B69\u5B50\u54ED\u95F9\u540C\u6837\u4E5F\u662F\u4F1A\u5BF9\u5468\u56F4\u7684\u4EBA\u9020\u6210\u5F71\u54CD\uFF0C\u603B\u4E0D\u80FD\u8FD8\u8981\u6342\u4F4F\u5B69\u5B50\u7684\u53E3\u9F3B\u5427\u3002</p><p>\u5C0A\u91CD\u4E00\u4E2A\u5A74\u513F\u7684\u8FDB\u98DF\u6743\u5E94\u8BE5\u662F\u6587\u660E\u793E\u4F1A\u5E94\u8BE5\u8981\u5F62\u6210\u7684\u4E00\u4E2A\u5171\u8BC6\uFF0C\u51FA\u53F0\u76F8\u5173\u653F\u7B56\u652F\u6301\u516C\u5171\u573A\u6240\u54FA\u4E73\u4E5F\u662F\u5408\u7406\u7684\u3002@\u590F\u5929\u7684\u9648\u5C0F\u8212 \u8BF4\uFF0C\u7F8E\u52A0\u6FB3\uFF0C\u90FD\u6709\u7ACB\u6CD5\u4FDD\u62A4\u5988\u5988\u4EEC\u968F\u65F6\u968F\u5730\u54FA\u4E73\u7684\u6743\u5229\uFF0C\u53F0\u6E7E\u4E5F\u6709\u76F8\u5173\u6761\u4F8B\uFF1A\u4EFB\u4F55\u4EBA\u4E0D\u5F97\u7981\u6B62\u3001\u9A71\u79BB\u3001\u59A8\u788D\u5973\u6027\u5728\u516C\u5171\u573A\u6240\u54FA\u4E73\u3002</p><p>\u77ED\u671F\u5185\u6211\u4EEC\u4E0D\u80FD\u50CF\u53D1\u8FBE\u56FD\u5BB6\u90A3\u6837\u914D\u5907\u5B8C\u5584\u7684\u6BCD\u5A74\u8BBE\u65BD\uFF0C\u90A3\u51FA\u53F0\u7C7B\u4F3C\u7684\u6761\u4F8B\u8FD8\u662F\u53EF\u884C\u7684\uFF0C\u6BD5\u7ADF\u6210\u672C\u4F1A\u66F4\u4F4E\uFF0C\u6709\u8FD9\u6837\u7684\u6761\u4F8B\u4E5F\u4F1A\u52A0\u5FEB\u5927\u5BB6\u89C2\u5FF5\u7684\u8F6C\u53D8\uFF0C\u4E5F\u80FD\u51CF\u5C11\u4E00\u4E9B\u65E0\u8C13\u7684\u7EB7\u4E89\u3002</p><p>\u5728\u5171\u8BC6\u5F62\u6210\u4E4B\u524D\uFF0C\u7EB7\u4E89\u5728\u6240\u96BE\u514D\uFF0C\u5982\u679C\u5171\u8BC6\u8FD8\u6CA1\u6709\u5F62\u6210\uFF0C\u90A3\u5C31\u5E94\u8BE5\u671D\u8FD9\u4E2A\u65B9\u5411\u53BB\u63A8\u52A8\uFF0C\u800C\u4E0D\u662F\u5404\u6267\u4E00\u8BCD\u76F8\u4E92\u653B\u51FB\uFF0C\u751A\u81F3\u628A\u522B\u4EBA\u54FA\u4E73\u7684\u7167\u7247\u4E0A\u4F20\u5230\u7F51\u4E0A\u4F9B\u5927\u5BB6\u6279\u5224\u3002</p><p>\u4F46\u5728\u6761\u4F8B\u51FA\u53F0\u4E4B\u524D\uFF0C\u54FA\u4E73\u5988\u5988\u5728\u5C3D\u91CF\u6EE1\u8DB3\u5B69\u5B50\u9700\u6C42\u7684\u57FA\u7840\u4E0A\uFF0C\u4E5F\u5E94\u8BE5\u5C3D\u91CF\u7167\u987E\u4E00\u4E0B\u522B\u4EBA\u7684\u89C2\u611F\uFF0C\u5C24\u5176\u662F\u5728\u6709\u5F88\u591A\u4EBA\u4E0D\u80FD\u63A5\u53D7\u8FD9\u79CD\u65B9\u5F0F\u7684\u5927\u73AF\u5883\u4E0B\uFF0C\u6709\u6761\u4EF6\u7684\u8FD8\u662F\u5C3D\u91CF\u4F7F\u7528\u54FA\u4E73\u5185\u8863\u6216\u8005\u54FA\u4E73\u5DFE\uFF0C\u6709\u4E9B\u73B0\u5B9E\u662F\u5FC5\u987B\u9762\u5BF9\u7684\uFF0C\u8C01\u53EB\u6211\u4EEC\u8FD8\u5904\u5728\u8FD9\u4E2A\u5FEB\u901F\u8F6C\u578B\u7684\u65F6\u4EE3\u5462\u3002</p>',20),l={href:"http://mp.weixin.qq.com/s?__biz=MzA5NzE5ODIyOQ==&mid=400677720&idx=1&sn=fb925903f91246453ab18ca1608834ab&scene=21#wechat_redirect",target:"_blank",rel:"noopener noreferrer"},h=s("\u67E5\u770B\u539F\u6587");function m(f,x){const p=a("ExternalLinkIcon");return r(),t(o,null,[i,e("p",null,[e("a",l,[h,n(p)])])],64)}var k=_(d,[["render",m]]);export{k as default};
